научно-педагогических кадров в аспирантуре','UPlyHbeOxMoUsngdJtaV7fgThP3hyeXsZuIYJt19.pdf',1,'Направления и профили аспирантуры.pdf','file','77wzsofep46nyngu1l8pw',NULL,499,'2020-06-26 21:47:32','2020-06-29 20:42:26','pdf'),(499,NULL,NULL,0,NULL,'files',NULL,58,NULL,'2020-06-23 19:00:39','2020-06-23 19:00:39',NULL),(500,'Перечень направлений подготовки','UGIC0oFc5ef4K5wRE513ezC0e6xFQKTjS9VrCDKp.pdf',0,'Перечень направлений подготовки.pdf','file','g5dn4wnxkjtqenco8x5qt',NULL,499,'2020-06-23 19:00:39','2020-06-26 21:39:21','pdf'),(501,'Научные руководители','HuvP9ECnCDtdtail1nDcPpcKF4j0uomG53YumZrz.pdf',2,'Научные руководители.pdf','file','so81mrz9dqfmvkx7sjldyk',NULL,499,'2020-06-23 19:00:39','2020-06-29 20:42:26','pdf'),(558,'Информация о сроках зачисления на обучение','wTSY2ZJykYGR4fwhW7BonoiG9mte1dox5dXKIQ88.pdf',6,'Информация о сроках зачисления на обучение.pdf','file','lq8egq9kp6kig5sx7i432l',NULL,46,'2020-06-26 21:58:10','2020-06-26 21:59:03','pdf'),(561,'Формирование списков поступающих, допущенных к участию в конкурсах на зачисление','YjMhB10TLOfOqin6vCl82bo9qq4BO4UM4khJTRNS.pdf',7,'Формирование списков поступающих, допущенных к участию в конкурсах на зачисление.pdf','file','e4aqwzja08fkxzi971ysp',NULL,46,'2020-06-26 22:22:39','2020-06-26 22:23:51','pdf'),(562,'Сроки приёма документов от поступающих',NULL,2,'<p>	Приём документов на обучение по программам аспирантуры осуществляется в следующие сроки:</p><ul><li>на места в рамках контрольных цифр приема – <strong>с 6 июля по 21 августа 2020 года</strong>;</li><li>по договорам об оказании платных образовательных услуг – <strong>с 6 июля по 25 сентября 2020 года</strong>.</li></ul><p>	</p><p>	Если подача производится через операторов почтовой связи общего пользования ценным письмом с заверенной описью вложения по адресу работы приёмной комиссии Университета: г. Саранск, ул. Полежаева, 44/3, Учебный корпус № 28, кабинет № 318 – указанные <strong>документы принимаются</strong>, если они поступили в Университет <strong>не позднее срока завершения приёма документов</strong>.</p><p><br></p>','text',NULL,56,NULL,'2020-06-26 22:26:44','2020-07-14 11:09:02',NULL),(564,'Индивидуальные достижения','XK5vJ4DRoodHxh3lsbzCAXEYGtBhGzdVcem5nVbD.pdf',0,'Индивидуальные достижения.pdf','file','1og82z1g8diahgnm8emzht',NULL,563,'2020-06-26 22:31:11','2020-06-26 22:31:11','pdf'),(565,'Образец оформления списка публикаций','JGtuS837xNrnlGK2dC17z6OSAplazYC5TieyLoUQ.docx',1,'Образец оформления списка публикаций.docx','file','fbej8kkzsldsb54fm67of',NULL,563,'2020-06-26 22:31:11','2020-06-26 22:31:11','docx'),(616,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году',NULL,4,NULL,'files',NULL,62,NULL,'2020-07-13 10:14:36','2020-07-14 12:51:36',NULL),(602,NULL,NULL,0,'<p>	<strong>Может ли иностранный гражданин поступать на бюджет?</strong></p><p>	Иностранные граждане из Белоруссии, Казахстана, Киргизии и Таджикистана, а также соотечественники могут поступать на бюджетные места наравне с гражданами РФ в соответствии со ст. 17 Федерального закона от 24 мая 1999 г. N 99-ФЗ \"О государственной политике Российской Федерации в отношении соотечественников за рубежом\" (с изменениями и дополнениями). Конкурс на бюджетные места является общим.</p><p>	Иностранные граждане стран ближнего и дальнего зарубежья также могут поступать на бюджетную форму обучения по программам высшего образования через Россотрудничество в рамках квоты Правительства РФ. Система подачи заявок доступна по адресу <a href=\"https://www.russia.study/ru\" rel=\"noopener noreferrer\" target=\"_blank\">www.russia.study</a>.</p><p><br></p><p>	<strong>Как подтвердить статус соотечественника? </strong></p><p>	При подаче заявления на прохождение вступительных испытаний необходимо предоставить документы, подтверждающие, что Ваши родственники по восходящей линии были гражданами СССР (Ваш паспорт и&nbsp;свидетельство о рождении с переводом на русский язык, паспорт и свидетельство о рождении с переводом на русский язык одного из родственников, рожденных в СССР). Если у родителя была осуществлена смена фамилии – необходим также документ, подтверждающий это (например, свидетельство о вступлении в брак) с переводом на русский язык.</p><p><br></p><p>	<strong>Если иностранный гражданин сдал ЕГЭ, но результат не понравился, может ли он сдать вступительные испытания?</strong></p><p>	Да, иностранный абитуриент может подать документы и указать вступительные испытания по одному или нескольким предметам даже в том случае, если он сдавал по ним ЕГЭ. </p><p>	<span style=\"color: rgb(230, 0, 0);\">Важно!</span> После записи на вступительные испытания, результат ЕГЭ по этому предмету для нашего университета будет недействителен. Поэтому следует подойти к решению серьезно.</p><p><br></p><p>	<strong>Нотариальный перевод документов необходимо оформлять в России или можно у себя в стране?</strong></p><p>	Заверить переводы документов можно в консульском отделе Посольства Российской Федерации в своей стране, а также у нотариуса на территории Российской Федерации.</p><p><br></p><p>	<strong>Если документ об образовании оформлен на двух языках, один из которых – русский, нужен ли перевод информации на иностранном языке?</strong></p><p>	Если информация в документе об образовании полностью продублирована на русском языке, то дополнительно переводить документ не требуется.</p><p><br></p><p>	<strong>Как можно сдать экзамены дистанционно?</strong></p><p>	Вступительные испытания с применением дистанционных технологий проводятся на основании \"<a href=\"https://abiturs.mrsu.ru/storage/section-files/fuYIoA5vyvbCVV5bJ7Roze76ueUnDlawjUIUJDZk.pdf\" rel=\"noopener noreferrer\" target=\"_blank\">Порядка проведения вступительных испытаний с применением дистанционных технологий в Федеральном государственном бюджетном образовательном учреждении высшего образования «Мордовский государственный университет им. Н.П. Огарёва»</a>\".</p><p><br></p><p>	<strong>На сколько направлений можно подать документы?</strong></p><p>	В соответствии с Правилами приема абитуриент имеет подать документы в 5 вузов на 3 направления подготовки в каждом вузе.</p><p><br></p><p>	<strong>Можно ли остановиться в общежитии на время сдачи вступительных испытаний?</strong></p><p>	Да, иностранные абитуриенты могут временно поселиться в общежитиях Студенческого городка Университета. При заселении необходимо предоставить документы, подтверждающие прохождение медицинского осмотра (справка), а также служебную записку, получаемую абитуриентом в Управлении международных связей при постановке на миграционный учет.</p>','text',NULL,74,NULL,'2020-07-09 06:31:35','2020-07-14 11:18:12',NULL),(563,NULL,NULL,0,NULL,'files',NULL,76,NULL,'2020-06-26 22:31:11','2020-06-26 22:31:11',NULL),(515,'Особенности организации приема на целевое обучение в аспирантуру','ZDGhgdmaamfpX7yU3n8RL6RmIG1e4HDXErnV5Fh2.pdf',4,'Особенности организации приема на целевое обучение в аспирантуру.pdf','file','fkf7m6awmij37mpd9z8xb7',NULL,46,'2020-06-23 20:46:59','2020-06-25 08:32:49','pdf'),(566,NULL,NULL,0,NULL,'files',NULL,77,NULL,'2020-06-30 12:26:17','2020-06-30 12:26:17',NULL),(560,'Почтовый адрес организации','wnDIHTLXr0TVyjyAKPEBskfn2T6EyhFgAsmnCZci.pdf',9,'Почтовый адрес организации.pdf','file','1ry5ihmxzdhppx705agb8g',NULL,46,'2020-06-26 22:13:59','2020-06-26 22:23:56','pdf'),(516,'Особенности проведения приема иностранных граждан и лиц без гражданства','1sBy8XgJgxrqLvxcfOqEs8bnX39OryfkvO7oRX9y.pdf',5,'Особенности проведения приема иностранных граждан и лиц без гражданства.pdf','file','odp5iuq4jp1quo0kr565r',NULL,46,'2020-06-23 20:50:56','2020-06-25 08:32:47','pdf'),(517,NULL,NULL,0,NULL,'files',NULL,61,NULL,'2020-06-24 06:14:36','2020-06-24 06:14:36',NULL),(518,'Стоимость обучения ординаторов первого года обучения для российских граждан (2020-2021 учебный год)','1iQ8gv8A5XoBBDYLCSi7q4NhPlpZu2q8R9ZYq89H.pdf',0,'Стоимость обучения ординаторов первого года обучения для российских граждан (2020-2021 учебный год).pdf','file','ns47d8nx1vrk7xyi5m77w',NULL,517,'2020-06-24 06:14:36','2020-06-24 06:17:22','pdf'),(519,'Стоимость обучения ординаторов первого года обучения для иностранных граждан (2020-2021 учебный год)','pJjX3mfymGq9fmhvqwFx4Bvzj95rTzNFVZiriII9.pdf',1,'Стоимость обучения ординаторов первого года обучения для иностранных граждан (2020-2021 учебный год).pdf','file','6kudt32i2v2m3h1ev4r168',NULL,517,'2020-06-24 06:14:36','2020-06-24 06:17:22','pdf'),(520,'Правила приема на обучение по образовательным программам высшего образования – программам ординатуры',NULL,0,NULL,'files',NULL,62,NULL,'2020-06-24 06:24:40','2020-06-24 07:54:14',NULL),(521,'Правила приёма в ординатуру (2020)','mpL7skom0RS8keHrXXq0FQB6tRnEE5OOl5sclRSK.pdf',0,'Правила приема в ординатуру (2020).pdf','file','pnprdidosof467p4l9vnb',NULL,520,'2020-06-24 06:24:40','2020-06-24 07:38:15','pdf'),(522,'',NULL,0,'<p>&nbsp;Университет осуществляет прием по следующим условиям поступления на обучение (далее условия поступления) с проведением отдельного конкурса по каждой совокупности этих условий:</p><p><br></p><p>&nbsp;&nbsp;- раздельно по программам ординатуры в зависимости от специальности;</p><p><br></p><p>&nbsp;&nbsp;- раздельно в рамках контрольных цифр и по договорам об оказании платных образовательных услуг;</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места в пределах целевой квоты и на места в рамках контрольных цифр за вычетом целевой квоты (далее основные места в рамках контрольных цифр);</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места для приема граждан Российской Федерации, лиц, указанных в пункте 9.3 и 9.5. Правил приема в ординатуру, и иных иностранных граждан, лиц без гражданства.</p>','text',NULL,63,NULL,'2020-06-24 06:27:32','2020-06-24 06:50:35',NULL),(424,'II. ВСТУПИТЕЛЬНЫЕ ИСПЫТАНИЯ',NULL,1,'<p>	<strong style=\"color: black;\">1. </strong>Для поступления на программы магистратуры поступающий сдает междисциплинарный экзамен по программе соответствующего бакалавриата, которые размещены по <a href=\"https://abiturs.mrsu.ru/Magistratura-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">ссылке</a>.</p><p><br></p><p>	<strong style=\"color: black;\">2. </strong>Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные <strong><u>документально</u></strong>), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p><br></p><p>	<strong style=\"color: black;\">3. </strong>Вступительные испытания организуются и проводятся с использованием средств информационно-коммуникационной сети «Интернет»&nbsp;в режиме видеоконференции или тестирования.&nbsp;&nbsp;&nbsp;</p><p>	Поступающие, участвующие во вступительных испытаниях, должны обеспечить наличие следующих компонентов: </p><p>	1) компьютер (операционная система не ниже Windows 7, macOS 11 и выше) с веб-камерой (встроенная, либо внешняя) с разрешением не менее 640х480 или смартфон (операционной системой Android не ниже 5.0, IOS не ниже 11.0) с камерой.</p><p>	2) канал доступа в информационно-коммуникационную сеть «Интернет» пропускной способностью не менее 5 Мбит/с.</p><p>	Техническое сопровождение организации и проведения вступительных испытаний со стороны университета осуществляется сотрудниками технического секретариата приемной комиссии, а также соответствующих подразделений университета. </p><p><br></p><p>	<strong style=\"color: black;\">4. </strong>Перед началом вступительного испытания ответственное лицо из состава технического секретариата приемной комиссии (далее – ответственное лицо) осуществляет идентификацию личности поступающего средствами телеконференцсвязи, определенной университетом, путём визуальной сверки предоставленной фотографии поступающего, документа удостоверяющего личность, с лицом, вышедшим на связь. В ходе идентификации также должны быть подтверждены персональные данные поступающего, указанные в заявлении (дата рождения, паспортные данные, адрес регистрации места жительства). </p><p>	Ответственное лицо проверяет состояние рабочего места поступающего. Для этого, с помощью веб-камеры поступающий должен обеспечить последовательный подробный обзор рабочего места для контроля присутствия посторонних лиц, справочной литературы и др. Во время вступительного испытания запрещается выключать видео- и аудио-режим трансляции. В случае обрыва связи, абитуриент должен немедленно возобновить соединение.</p><p><br></p><p>	<strong>5.</strong> Ход проведения вступительных испытаний: </p><p>	1) в форме тестирования – организуется на образовательном портале университета. С правилами тестирования и временем, которое отводится на выполнение заданий, поступающий знакомится на сайте&nbsp;перед тестированием. После завершения тестирования или истечения времени, которое отводится на выполнение заданий, выставляется оценка в соответствии с критериями оценки знаний. </p><p>	2) в форме устного экзамена – организуется средствами видеоконференцсвязи, определенной университетом: поступающий получает экзаменационные задания (билеты, вопросы для собеседования), определенные на сайте случайным образом; подготовка к ответу осуществляется непосредственно за тем же рабочим местом, где состоялась процедура идентификации. При подготовке к ответу оставляет записи на листе устного ответа, который затем сканируется (фотографируется) и размещается в личном кабинете поступающего. Через 30 минут, выделенных на подготовку, отвечает экзаменационной комиссии в режиме непосредственного общения с помощью средств телеконференцсвязи.</p><p><br></p><p>	<strong>6. </strong>Во время проведения вступительного испытания поступающий может пользоваться только письменными принадлежностями и чистыми листами. Во время проведения вступительного испытания поступающему запрещается пользоваться средствами связи.</p><p><br></p><p>	<strong>7. </strong>При нарушении поступающим во время проведения вступительного испытания с использованием дистанционных технологий настоящих Правил члены экзаменационной комиссии составляют акт о нарушении Правил.&nbsp;Электронная копия указанного акта направляется поступающему.&nbsp;Поступающий, в отношении которого составлен акт, признается не прошедшим вступительное испытание без уважительной причины. </p><p>	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные документально), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p><br></p><p>	<strong>8.</strong> В целях обеспечения контроля за проведением вступительных испытаний осуществляется видеозапись, о чем поступающего предупреждает ответственное лицо. Видеозаписи хранятся 1 год в электронной информационно-образовательной среде университета и могут быть использованы при рассмотрении апелляций.&nbsp;&nbsp;&nbsp;</p><p><br></p><p>	<strong>9.</strong> Объявление оценок, полученных поступающими в ходе вступительных испытаний осуществляется на официальном сайте в следующем порядке: </p><p>	– по письменным формам испытаний – не позднее трех рабочих со времени проведения испытания; </p><p>	– по устной форме – в течение 30 минут после ответа в режиме телеконференцсвязи, а также публикуются на официальном сайте не позднее следующего рабочего дня со времени проведения испытания.</p><p>&nbsp;</p>','text',NULL,51,NULL,'2020-06-19 07:52:38','2020-07-14 12:53:41',NULL),(425,'III. ПРОЦЕДУРА ЗАЧИСЛЕНИЯ В УНИВЕРСИТЕТ',NULL,2,'<p>	<strong style=\"color: black;\">1.&nbsp;</strong>По результатам приема документов и (или) вступительных испытаний Университет формирует списки поступающих (далее – списки поступающих). </p><p>	</p><p>	<strong style=\"color: black;\">2. </strong><span style=\"color: black;\">Конкурсные списки ранжируются по убыванию суммы конкурсных баллов (сумма баллов за вступительные испытания + баллы за индивидуальные достижения. </span></p><p>	</p><p>	<strong style=\"color: black;\">3.</strong><span style=\"color: black;\"> Для зачисления, поступающие </span><strong style=\"color: red;\">тем же способом, что были поданы документы для участия в конкурсе на зачисление,</strong><span style=\"color: red;\"> &nbsp;</span><span style=\"color: black;\">представляют не позднее 18.00 по местному времени рабочего дня, установленного Университетом в качестве даты завершения приема документов, необходимых для поступления, </span><strong style=\"color: red;\">согласие на зачисление</strong><span style=\"color: black;\">. </span></p><p>	<span style=\"color: black;\">В списках поступающих по каждому поступающему указывается наличие в университете согласия на зачисление.</span></p><p><span style=\"color: black;\"> </span></p><p>	<strong style=\"color: black;\">4.</strong><span style=\"color: black;\"> </span>Зачисление поступающих проводится в направлении от начала к концу списка поступающих, до заполнения имеющихся мест для приема.</p><p><br></p><p>	<strong>5.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p>	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>10 августа</u></strong>;</p><p>	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p>	<strong><u>12 августа в 18.00</u></strong><u>: </u></p><p>	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p>	<strong><u>13 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p>	в) этап зачисления по общему конкурсу:</p><p>	<strong><u>13 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p>	<strong><u>13 августа в 18.00: </u></strong></p><p>	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p>	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p>	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p><br></p><p>	<strong>6.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>заочной</strong> форме обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p>	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>12 августа</u></strong>;</p><p>	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p>	<strong><u>13 августа в 18.00</u></strong><u>: </u></p><p>	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p>	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p>	в) этап зачисления по общему конкурсу:</p><p>	<strong><u>14 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p>	<strong><u>14 августа в 18.00: </u></strong></p><p>	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p>	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p>	<strong><u>15 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p><br></p><p>	<strong>7.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам магистратуры &nbsp;по очной, очно-заочной и заочной формам обучения:</p><p>	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>28 августа</u></strong>;</p><p>	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p>	<strong><u>29 августа</u></strong> завершается прием заявлений о согласии на зачисление;</p><p>	<strong><u>31 августа</u></strong> издается приказ (приказы) о зачислении.</p><p><br></p><p>	<strong style=\"color: red;\">ВАЖНО! Обязательным условием зачисления на места с оплатой стоимости обучения является заключение договора об оказании платных образовательных услуг и внесение предоплаты, размер которой согласуется при заключении договора.</strong></p><p><br></p>','text',NULL,51,NULL,'2020-06-19 07:53:15','2020-07-14 12:53:43',NULL),(675,'Результаты тестирования 07.08.2020',NULL,11,'<ol><li>   Авакова Софья Михайловна 100</li><li>   Агафонова Александра Владимировна 100</li><li>   Алушкин Евгений Николаевич 100</li><li>   Антонов Николай Викторович 96</li><li>   Асриян Артём Юрьевич 90</li><li>   Власов Владимир Викторович 100</li><li>   Дарбинян Ануш Оганесовна 100</li><li>   Десятник Нина Васильевна 100</li><li>   Желтов Анатолий Александрович 95</li><li>   Кипайкина Алина Юрьевна 100</li><li>   Колесниченко Анастасия Александровна 98</li><li>   Королев Максим Витальевич 100</li><li>   Котельникова Анна Владимировна 100</li><li>   Коцура Ольга Владимировна 100</li><li>   Кулиниченко Мария Максимовна 98</li><li>   Кшнякина Екатерина Леонидовна 96</li><li>   Максименко Дмитрий Геннадьевич 100</li><li>   Маслихова Наталья Владимировна 100</li><li>   Мащикова Дарья Дмитриевна 96</li><li>   Мельникова Анастасия Алексеевна 98</li><li>   Миннеханова Алсу Илнуровна 100</li><li>   Митрофанова Александра Вячеславовна 96</li><li>   Морозова Анастасия Сергеевна 98</li><li>   Морозова Валерия Анатольевна 100</li><li>   Николенко Диана Владимировна 93</li><li>   Николенко Сергей Олегович 90</li><li>   Павлов Дмитрий Сергеевич 100</li><li>   Панферова Татьяна Владимировна 96</li><li>   Подшивалова Ирина Александровна 100</li><li>   Порядочная Полина Андреевна 100</li><li>   Романенко Карина Романовна 98</li><li>   Сатышев Игорь Иванович 96</li><li>   Серикова Юлия Олеговна 98</li><li>   Соболева Дарья Викторовна 100</li><li>   Турсунов Баходир Бустонович 96</li><li>   Усанова Мария Владимировна 100</li><li>   Уторова Аида Рафиковна 96</li><li>   Хейгетян Артур Федорович 100</li><li>   Хуснуллин Ильбир Марсович 100</li><li>   Шутикова Анна Владимировна 98</li><li>   Яфуняева Айсылу Рашидовна 95  </li></ol>','text',NULL,67,NULL,'2020-08-05 09:15:18','2020-08-24 13:54:20',NULL),(532,'Репетиционный экзамен',NULL,0,'<p>Вступительное испытание проводится в форме тестирования.</p><p>Пройти репетиционное тестирование можно на сайте Методического центра аккредитации.</p><p>Количество попыток не ограничено.</p><p><br></p><p>Комплектование набора тестовых заданий осуществляется программным обеспечением из единой базы оценочных средств.</p><p><br></p><p>Перед прохождением репетиционного экзамена ознакомьтесь с&nbsp;<a href=\"https://fmza.ru/upload/medialibrary/0e1/instruktsiya-re_obnovl.26.03.2018-g..pdf\" rel=\"noopener noreferrer\" target=\"_blank\">Инструкцией</a>.</p><p><br></p><p><a href=\"https://selftest.mededtech.ru/\" rel=\"noopener noreferrer\" target=\"_blank\">РЕПЕТИЦИОННЫЙ ЭКЗАМЕН</a></p>','text',NULL,67,NULL,'2020-06-24 06:45:16','2020-07-16 07:20:53',NULL),(530,'',NULL,2,NULL,'files',NULL,65,NULL,'2020-06-24 06:36:58','2020-07-14 10:48:48',NULL),(531,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении','erfKzNsh9G02OdWC5LgTwdOVydhbpop5o1smOsFa.pdf',0,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении.pdf','file','72uisjoiirwclzqqy4j0fm',NULL,530,'2020-06-24 06:36:58','2020-06-24 06:36:58','pdf'),(533,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру',NULL,1,NULL,'files',NULL,67,NULL,'2020-06-24 06:46:25','2020-07-16 07:20:53',NULL),(534,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру','yqs5CRkDvy2DmSCIl9CrbwoZUVGMjCgjOE0NkgA6.pdf',0,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру.pdf','file','flhpvzjakj2w6p9x015u5',NULL,533,'2020-06-24 06:46:25','2020-06-24 06:46:25','pdf'),(535,'Сроки проведения вступительных испытаний в ординатуру',NULL,0,'<p>Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места в рамках контрольных цифр приема, завершаются не позднее <strong>11 августа 2020 г</strong>. При условии продления приема по основаниям, указанным в п. 3.15 Правил приема в ординатуру, не позднее&nbsp;<strong>26 августа 2020 г</strong>. Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места по договорам об оказании платных образовательных услуг, завершаются не позднее&nbsp;<strong>27 августа 2020 г</strong>.</p>','text',NULL,67,NULL,'2020-06-24 06:47:25','2020-07-31 11:24:30',NULL),(536,'Общие правила подачи и рассмотрения апелляций',NULL,3,'<p>1. По результатам решения экзаменационной комиссии о прохождении вступительного испытания поступающий (доверенное лицо) вправе подать в апелляционную комиссию апелляцию о нарушении, по мнению поступающего, установленного порядка проведения вступительного испытания и (или) о несогласии с полученной оценкой результатов вступительного испытания.&nbsp;</p><p><br></p><p>2. Рассмотрение апелляции не является пересдачей вступительного испытания. В ходе рассмотрения апелляции проверяется соблюдение установленного порядка проведения вступительного испытания и (или) правильность оценивания результатов вступительного испытания.</p><p><br></p><p>3. Апелляция подается одним из способов, указанных в п.3.2 Правил приема в ординатуру.</p><p><br></p><p>4. Апелляция подается в день объявления результатов вступительного испытания или в течение следующего рабочего дня. Рассмотрение апелляций проводится не позднее следующего рабочего дня после дня подачи апелляции.</p><p><br></p><p>5. При рассмотрении апелляции имеют право присутствовать поступающий (доверенное лицо), который должен иметь при себе документ, удостоверяющий его личность.</p><p><br></p><p>6. После рассмотрения апелляции апелляционная комиссия принимает решение об изменении оценки результатов вступительного испытания или оставлении указанной оценки без изменения. Оформленное протоколом решение апелляционной комиссии доводится до сведения, поступающего (доверенного лица). Факт ознакомления, поступающего (доверенного лица) с решением апелляционной комиссии заверяется подписью поступающего (доверенного лица).</p>','text',NULL,67,NULL,'2020-06-24 06:47:54','2020-08-08 10:51:06',NULL),(672,'Результаты тестирования 03.08.2020',NULL,13,'<ol><li>   Алькаева Эльвира Ринатовна 100</li><li>   Андриянов Антон Николаевич 100</li><li>   Ашрафзян Юлия Рашидовна 100</li><li>   Бамбурин Сергей Вячеславович 98</li><li>   Бегаев Дмитрий Николаевич 100</li><li>   Бобохонов Саидбаходур Саидсул