фья Владимировна   98</li><li>   Тутаева Анна Валерьевна   96</li><li>   Улмасов Шавкатджон Хуршеджанович   98</li><li>   Урусова Асият Исхаковна   96</li><li>   Утина Марина Николаевна   98</li><li>   Федоськина Анна Сергеевна   96</li><li>   Филяева Анастасия Сергеевна   100</li><li>   Фролова Жанна Евгеньевна   98</li><li>   Цыганков Даниил Александрович   95</li><li>   Шабдарова Екатерина Владимировна   100</li><li>   Янышев Александр Андреевич   98</li></ol>','text',NULL,67,NULL,'2020-07-22 12:25:18','2020-08-24 13:54:04',NULL),(640,' Pre-University tutorials department',NULL,0,'<p class=\"ql-align-justify\">Pre-University tutorials department offers preparatory courses for foreign citizens and persons without citizenship to be able to further apply for degree programs in Russian.</p><p class=\"ql-align-justify\">Academic profiles taught are:</p><p class=\"ql-align-justify\"><br></p><ul><li class=\"ql-align-justify\">Natural science (Russian language, mathematics, physics and chemistry);</li><li class=\"ql-align-justify\">Engineering and technology (Russian language, mathematics, physics and computer science);</li><li class=\"ql-align-justify\">Humanities (Russian language, social studies, history and literature);</li><li class=\"ql-align-justify\">Economics (Russian language, social studies, history and mathematics);</li><li class=\"ql-align-justify\">Medicine and biology (Russian language, chemistry, biology and physics).</li></ul>','text',NULL,86,NULL,'2020-07-24 13:14:22','2020-07-27 18:56:03',NULL),(641,'Academic studies',NULL,1,'<p class=\"ql-align-justify\">Students learn Russian, as well as general education subjects to be able to apply for a degree program in Russian. The Russian language course is a major part of the preparatory courses curriculum. </p><p class=\"ql-align-justify\">Classes in Russian give a unique opportunity for foreign students to lay a solid foundation in Russian grammar and acquire oral and written language skills, as well as to compartmentalize knowledge in subjects of the chosen academic profile.</p><p>Prior to classes, learners are tested as to determine the level of Russian language proficiency and be put in the appropriate group within the five language levels - from elementary to advanced. All Russian language programs are studied in a fast-paced learning mode.</p><p><br></p><p><strong>Extracurricular activities</strong> are an integral part of the educational process and primarily aimed at introducing a learner to the culture of the host country. This is done by getting learners involved in competitions, academic Olympics, cultural, sports and other events held at the University.</p>','text',NULL,86,NULL,'2020-07-24 13:16:27','2020-07-24 13:16:57',NULL),(642,'Certificate of completion',NULL,2,'<p class=\"ql-align-justify\">After completion of their studies and successful passing of the examinations at the Pre-University Tutorials Department, foreign citizens are issued a certificate of completion of the course.</p>','text',NULL,86,NULL,'2020-07-24 13:16:46','2020-07-24 13:16:46',NULL),(643,' ',NULL,0,'<p><strong>1. </strong>Foreign citizens and persons without citizenship have the right to higher education at the expense of Russian federal budget allocations (state-financed education) in accordance with </p><p>	a) international treaties of the Russian Federation, </p><p>	b) federal laws or </p><p>	c) the quota established by the Government of the Russian Federation for the education of foreign citizens and persons without citizenship (hereinafter referred to as the education quota), as well as </p><p>	d) at their own funds by negotiating contracts on reimbursement of fee-based educational services.</p><p><br></p><p><strong>2. </strong>Admission to study within the education quota for foreign citizens is carried out following the referral of the Federal Executive authority responsible for the formulation of state policy and legal regulation in the field of education. Matriculation to the University within the education quota is carried out by a separate order (orders) issued by the University.</p><p><br></p><p><strong>3. </strong>Foreign citizens and persons without citizenship who are fellow nationals (compatriots) living abroad have the right to higher education on an equal basis with citizens of the Russian Federation, provided that they comply with the requirements stipulated by the article 17 of Federal law No. 99-FZ dated of May 24, 1999 \"On state policy of the Russian Federation in relation to fellow nationals abroad\" (hereinafter referred to as Federal law No. 99-FZ).</p><p><br></p><p><strong>4.</strong> Fellow nationals abroad who are not citizens of the Russian Federation are not subject to special rights for admission to bachelor and specialist (5-year curriculum) programs offered in accordance with Federal law No. 273-FZ, unless otherwise specified by an international agreement of the Russian Federation.</p><p><br></p><p><strong>5.</strong> When admitting foreign citizens and persons without citizenship to study bachelor and speciality (5-year curriculum) programs for places allocated for contracts on reimbursement of fee-based educational services (fee-based tuition), entrance trials are carried out in accordance with <u>Annex 6.</u> In this regard, a separate number of places for admission is allocated for foreign citizens and persons without citizenship and a separate competition is held for these places.</p><p><br></p><p><strong>6.</strong> Documents are accepted within the following deadlines:</p><p>	<img src=\"//:0\">1) foreign citizens and persons without citizenship specified in paragraph 5 above, apply within the time frame set by paragraph 18 of the Rules; </p><p>	2) foreign citizens and persons without citizenship applying for education under contracts on reimbursement of fee-based educational services (fee-based tuition), apply from <strong>June 20 to October 17, 2020.</strong></p><p><br></p><p><strong>7.</strong> When applying for admission to study a foreign citizen or a person without citizenship specifies in the application form the details of the identity document in accordance with article 10 of the Federal law of 25 July 2002&nbsp;No. 115-FZ \"On the legal status of foreign citizens in the Russian Federation\" (hereinafter referred to as the identity document of a foreign citizen), and submits, in accordance with subparagraph 1 of paragraph 68 of the Rules, an original or a copy of the identity document of a foreign citizen.</p><p><br></p><p><strong>8.</strong> When applying for admission in accordance with article 17 of Federal law No. 99-FZ, a fellow national (compatriot) submits, in addition to the documents specified in paragraph 68 of the Rules, originals or copies of documents provided for in article 17 of Federal law No. 99-FZ. Foreign citizens who apply on the basis of international agreements, in addition to the documents specified in paragraph 68 of the Procedure, submit documents confirming their classification as persons specified in the relevant international agreements.</p><p><br></p><p><strong>9.</strong> Matriculation of foreign citizens and persons without citizenship specified in paragraph 133 of the present policy to places financed from budget allocations is carried out within the time frame set in paragraphs 118-123 of the Rules.</p><p><br></p><p><strong>10.</strong> Matriculation of foreign citizens and persons without citizenship to places under contracts on rendering fee-based educational services (fee-based tuition) is carried out until October 24, 2020.</p><p><br></p><p><strong>11.</strong> Admission of foreign citizens and persons without citizenship to educational programs containing information constituting a state secret is carried out only within the education quota in compliance with the requirements stipulated by the legislation of the Russian Federation on state secrets.</p><p><br></p>','text',NULL,87,NULL,'2020-07-24 13:24:38','2020-07-27 19:52:55',NULL),(644,NULL,NULL,0,'<p>Foreign citizens and persons without citizenship have the right to receive higher education through budgetary allocations on par with citizens of the Russian Federation in accordance with international treaties of the Russian Federation;</p><p><br></p><p>also foreign citizens and persons without citizenship who are fellow nationals (compatriots) living abroad have the right to higher education on par with citizens of the Russian Federation under condition of their compliance with the requirements of article 17 of the Federal law issued on 24 May 1999 No. 99-FZ «On the state policy of the Russian Federation in relation to compatriots living abroad» (hereinafter referred to as Federal law No. 99-FZ).</p><p><br></p><p>To confirm the status of a compatriot, when applying for entrance trials, you must provide documents confirming that Your ascendants were citizens of the USSR:</p><p><br></p><ul><li>Your passport and birth certificate with translation into Russian,</li><li>passport and birth certificate with translation into Russian of one of the relatives born in the USSR. If a parent has changed his/her last name, you must provide document confirming this (for example, a marriage certificate) with a translation into Russian.</li></ul><p><br></p>','text',NULL,88,NULL,'2020-07-24 13:25:43','2020-07-27 19:00:08',NULL),(656,NULL,NULL,0,'<p><strong>1.</strong> Foreign citizens and persons without citizenship have the right to higher education at the expense of Russian federal budget allocations (state-financed education) in accordance with </p><p>	a) international treaties of the Russian Federation, </p><p>	b) federal laws or </p><p>	c) the quota established by the Government of the Russian Federation for the education of foreign citizens and persons without citizenship (hereinafter referred to as the education quota), as well as </p><p>	d) at their own funds by negotiating contracts on reimbursement of fee-based educational services.</p><p><br></p><p><strong>2.</strong> Admission to study within the education quota for foreign citizens is carried out following the referral of the Federal Executive authority responsible for the formulation of state policy and legal regulation in the field of education. Matriculation to the University within the education quota is carried out by a separate order (orders) issued by the University.</p><p><br></p><p><strong>3.</strong> Foreign citizens and persons without citizenship who are fellow nationals (compatriots) living abroad have the right to higher education on an equal basis with citizens of the Russian Federation, provided that they comply with the requirements stipulated by the article 17 of Federal law No. 99-FZ dated of May 24, 1999 \"On state policy of the Russian Federation in relation to fellow nationals abroad\" (hereinafter referred to as Federal law No. 99-FZ).</p><p><br></p><p><strong>4.</strong> Fellow nationals abroad who are not citizens of the Russian Federation are not subject to special rights for admission to bachelor and specialist (5-year curriculum) programs offered in accordance with Federal law No. 273-FZ, unless otherwise specified by an international agreement of the Russian Federation.</p><p><br></p><p><strong>5.</strong> When admitting foreign citizens and persons without citizenship to study bachelor and speciality (5-year curriculum) programs for places allocated for contracts on reimbursement of fee-based educational services (fee-based tuition), entrance trials are carried out in accordance with <u>Annex 6.</u> In this regard, a separate number of places for admission is allocated for foreign citizens and persons without citizenship and a separate competition is held for these places.</p><p><br></p><p><strong>6.</strong> Documents are accepted within the following deadlines:</p><p>	1) foreign citizens and persons without citizenship specified in paragraph 5 above, apply within the time frame set by paragraph 18 of the Rules; </p><p>	2) foreign citizens and persons without citizenship applying for education under contracts on reimbursement of fee-based educational services (fee-based tuition), apply from June 20 to October 17, 2020.</p><p><br></p><p><strong>7.</strong> When applying for admission to study a foreign citizen or a person without citizenship specifies in the application form the details of the identity document in accordance with article 10 of the Federal law of 25 July 2002&nbsp;No. 115-FZ \"On the legal status of foreign citizens in the Russian Federation\" (hereinafter referred to as the identity document of a foreign citizen), and submits, in accordance with subparagraph 1 of paragraph 68 of the Rules, an original or a copy of the identity document of a foreign citizen.</p><p><br></p><p><strong>8.</strong> When applying for admission in accordance with article 17 of Federal law No. 99-FZ, a fellow national (compatriot) submits, in addition to the documents specified in paragraph 68 of the Rules, originals or copies of documents provided for in article 17 of Federal law No. 99-FZ. Foreign citizens who apply on the basis of international agreements, in addition to the documents specified in paragraph 68 of the Procedure, submit documents confirming their classification as persons specified in the relevant international agreements.</p><p><br></p><p><strong>9.</strong> Matriculation of foreign citizens and persons without citizenship specified in paragraph 133 of the present policy to places financed from budget allocations is carried out within the time frame set in paragraphs 118-123 of the Rules.</p><p><br></p><p><strong>10.</strong> Matriculation of foreign citizens and persons without citizenship to places under contracts on rendering fee-based educational services (fee-based tuition) is carried out until October 24, 2020.</p><p><br></p><p><strong>11.</strong> Admission of foreign citizens and persons without citizenship to educational programs containing information constituting a state secret is carried out only within the education quota in compliance with the requirements stipulated by the legislation of the Russian Federation on state secrets.</p>','text',NULL,90,NULL,'2020-07-27 19:20:36','2020-07-27 19:40:23',NULL),(645,'Is a foreign citizen eligible to apply for a state-financed education (Russian federal budget place scheme)?',NULL,0,'<p>Foreign citizens from Belarus, Kazakhstan, Kyrgyzstan and Tajikistan, as well as compatriots, can apply for a state-financed scheme (budget places) on an equal basis with citizens of the Russian Federation in accordance with article 17 of the Federal law dated of May 24, 1999 N 99-FZ \"On state policy of the Russian Federation in relation to compatriots living abroad\" (with amendments and additions). The competition for budget places is General.</p><p>Foreign citizens of the near and far abroad countries can also apply for a state-financed education through Rossotrudnichestvo within the quota of the Government of the Russian Federation. The application system is available at <a href=\"https://www.russia.study\" rel=\"noopener noreferrer\" target=\"_blank\">www.russia.study</a></p>','text',NULL,89,NULL,'2020-07-24 13:26:19','2020-07-31 11:17:19',NULL),(646,'How to prove the status of a fellow national (compatriot)?',NULL,1,'<p>When applying for entrance trials, you must provide proof that Your ascendants were Soviet citizens (Your passport and birth certificate with translation into Russian language, passport and birth certificate with translation into Russian language of one of relatives born in the USSR). If a parent has changed his/her last name, you also have to submit a document confirming this (for instance, a marriage certificate) with a translation into Russian.</p>','text',NULL,89,NULL,'2020-07-24 13:26:38','2020-07-31 11:17:32',NULL),(647,'If a foreign citizen passed the State Unified Examination (SUE), but is disappointed with its result, can s/he sit the entrance tests at the University?',NULL,2,'<p>Yes, a foreign applicant can submit documents and request entrance tests for one or more subjects, even if s/he passed the SUE in this or those subjects. </p><p><u style=\"color: rgb(230, 0, 0);\">Important!</u> After registering for the entrance tests, the results of the SUE in this/those subject renders it null and void for our University. Therefore, you should take the decision cautiously.</p>','text',NULL,89,NULL,'2020-07-24 13:26:52','2020-07-31 11:17:42',NULL),(648,'Shall a notarized translation of documents be made in Russia or in the country of my origin?',NULL,3,'<p>You can preferably certify translations of documents at the consular Department of the Embassy of the Russian Federation in your country, as well as at a notary in the Russian Federation.</p>','text',NULL,89,NULL,'2020-07-24 13:27:09','2020-07-31 11:18:28',NULL),(649,'If the education document is issued in two languages, one of which is Russian, do I need to translate the foreign language version?',NULL,4,'<p>If the information in the education document is a word for word translation into Russian, then you do not need to translate the document</p>','text',NULL,89,NULL,'2020-07-24 13:27:22','2020-07-24 13:27:22',NULL),(650,'How can I take examinations online?',NULL,5,'<p>Entrance tests with the use of remote learning technologies are carried out in compliance with «The procedure for conducting entrance tests with the use of remote learning technologies at the Federal state budgetary educational institution of higher education «Ogarev Mordovia State University».</p>','text',NULL,89,NULL,'2020-07-24 13:27:39','2020-07-31 11:18:14',NULL),(651,'How many degree programs can I apply for?',NULL,6,'<p>In accordance with the Admission Rules, the applicant has the right to submit documents to 5 universities for 3 degree programs in each University.</p>','text',NULL,89,NULL,'2020-07-24 13:27:53','2020-07-31 11:18:06',NULL),(652,'Can I stay in a dormitory while I go through the entrance trials?',NULL,7,'<p>Yes, foreign applicants can temporarily stay in dormitories on the University campus. By doing so, you must provide medical certificate ( proof of passed medical examination), and apply for an authorisation letter from International relations office when filing for migration registration there.</p>','text',NULL,89,NULL,'2020-07-24 13:28:05','2020-07-31 11:17:58',NULL),(653,'Результаты тестирования 27.07.2020',NULL,15,'<ol><li>   Акимова Татьяна Сергеевна 96</li><li>   Артамонов Михаил Вячеславович 91</li><li>   Байрамов Элвин Оруджович 96</li><li>   Безрукова Ольга Владимировна 100</li><li>   Беспалова Ирина Сергеевна 98</li><li>   Богдашова Дарья Сергеевна 100</li><li>   Богомолов Евгений Викторович 95</li><li>   Борискина Кристина Владимировна 98</li><li>   Бочкарёва Дарья Александровна 98</li><li>   Бренчагов Александр Владимирович 98</li><li>   Быстрова Ирина Геннадьевна 100</li><li>   Елисеев Сергей Дмитриевич 100</li><li>   Елхин Владислав Андреевич 98</li><li>   Иванкина Мария Евгеньевна 100</li><li>   Кашкин Матвей Сергеевич 100</li><li>   Колганов Андрей Николаевич 100</li><li>   Кострова Валерия Витальевна 98</li><li>   Кострова Юлия Александровна 91</li><li>   Кукушкин Вадим Сергеевич 95</li><li>   Куликова Наталья Андреевна 100</li><li>   Логинова Елена Олеговна 100</li><li>   Ломакина Екатерина Викторовна 98</li><li>   Машинова Анжелика Витальевна 98</li><li>   Мотолова Татьяна Геннадьевна 98</li><li>   Назаров Дмитрий Михайлович 98</li><li>   Наумкина Анна Михайловна 100</li><li>   Нуянзин Александр Витальевич 100</li><li>   Раджабов Джахонгир Неъматуллоевич  93</li><li>   Раупов Ахмаджон Акпарджонович 96</li><li>   Ребрушкин Артём Викторович 96</li><li>   Романчева Наталья Валерьевна 95</li><li>   Рузмайкин Михаил Васильевич 98</li><li>   Самойлова Маргарита Сергеевна 100</li><li>   Симакина Наталья Викторовна 100</li><li>   Таратынова Ольга Александровна 98</li><li>   Трифонова Евгения Александровна 100</li><li>   Хамидов Дилшод 